import react, { useState } from "react";

const List = (props) => {
   const items = props.items;
   const itemData = items.map((item) => {
      return {
         id: item.maThiSinh,
         name: item.tenThiSInh,
      };
   });
   const itemList = itemData.map((item) => {
      <li key={item.id}>{item.name}</li>;
   });
   return <ul>{itemList}</ul>;
};

export default List;
